import React from 'react'
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
    width: 100%;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    position: relative;
    margin-top: 20px;
    overflow: hidden;

`;
    


const SingleSlide = () => {
  return (
    <div>SingleSlide</div>
  )
}

export default SingleSlide;
